import { FC, useState } from "react"
import { ToggleButton } from "react-bootstrap"

const CheckButton: FC = () => {
    const [checked, setChecked] = useState<boolean>(false)

    return (
        <>
            <ToggleButton
                id="toggle-check"
                type="checkbox"
                variant="secondary"
                checked={checked}
                value="1"
                onChange={(e) => setChecked(e.currentTarget.checked)}
            >
                ✅
            </ToggleButton>
            <ToggleButton
                className="mb-2"
                id="toggle-check"
                type="checkbox"
                variant="outline-primary"
                checked={checked}
                value="1"
                onChange={(e) => setChecked(e.currentTarget.checked)}
            >
                Vista 
            </ToggleButton>
        </>
    )



}


export { CheckButton }
